def return_binary_or_hexa(numbers):
    a = numbers[46]
    b = numbers[91]
    total = 0

    for i in range(a + 1, b):
        if i not in numbers[46:92]:
            total += i

    if total % 2 == 0:
        return hex(total)[2:].upper()
    else:
        return bin(total)[2:]
```
Note: In the code above, the indices are adjusted by -1 as Python uses 0-based indexing. So, 'a' corresponds to index 45 and 'b' corresponds to index 90 in the tuple.
